tables.table_schema:
CREATE TABLE virtual_assistants (
  assistant_id SERIAL PRIMARY KEY,
  assistant_name VARCHAR(50) NOT NULL,
  assistant_type VARCHAR(50) NOT NULL,
  creation_date TIMESTAMP
);

CREATE TABLE user_ratings (
  rating_id SERIAL PRIMARY KEY,
  user_id INT NOT NULL,
  assistant_id INT NOT NULL,
  rating_value INT
);

CREATE TABLE User (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(255),
    email VARCHAR(255),
    phone_number VARCHAR(15)
);

CREATE TABLE RatingMetrics (
    rating_id INT PRIMARY KEY,
    metric_name VARCHAR(255),
    description TEXT
);

CREATE TABLE UserFeedback (
  feedback_id INT PRIMARY KEY,
  user_id INT,
  feedback_text TEXT,
  rating INT
);

CREATE TABLE Assistants (
  assistant_id INT PRIMARY KEY,
  assistant_name VARCHAR(50),
  department VARCHAR(50)
);

CREATE TABLE Departments (
  department_id INT PRIMARY KEY,
  department_name VARCHAR(50)
);
